import React from 'react';

const SearchBar = ({ setSearchTerm }) => {
  return (
    <input
      type="text"
      placeholder="Search cards..."
      style={{
        width: '100%',
        padding: '12px',
        marginBottom: '16px',
        borderRadius: '8px',
        border: '1px solid #ccc',
      }}
      onChange={(e) => setSearchTerm(e.target.value)}
    />
  );
};

export default SearchBar;
